pragma solidity ^0.7;

import "../client/node_modules/@openzeppelin/contracts/presets/ERC721PresetMinterPauserAutoId.sol";

contract CryptoPlant is ERC721PresetMinterPauserAutoId {
    uint256 public seedCost = 500;
    address payable public petaAddress;

    // address payable petaAddress = 0x42F323c617c0a6d18547B8a2AaF8BcD1Abe617c9;

    constructor()
        ERC721PresetMinterPauserAutoId(
            "CryptoPlant",
            "CPT",
            "https://my-json-server.typicode.com/abcoathup/samplenft/tokens/"
        )
    {
        petaAddress = 0x42F323c617c0a6d18547B8a2AaF8BcD1Abe617c9;
    }

    receive() external payable {}

    function transferEther() public payable {
        // address payable petaAddress =
        //     0x42F323c617c0a6d18547B8a2AaF8BcD1Abe617c9;

        petaAddress.transfer(msg.value);
    }

    function purchaseSeed() public payable {
        require(msg.value == 0.1 ether);

        petaAddress.transfer(0.09 ether);
        // (bool success, ) =
        //     petaAddress.call{gas: 1000000, value: 0.09 ether}("");

        // (bool success, ) = petaAddress.call{value: 0.09 ether}("");
        // require(success, "Transfer failed.");
    }
}
